import React, { Component } from 'react';
import EnhancedTable  from './table';
import axios from 'axios';


class TableData extends Component {


    componentDidMount() {
        const Url = 'https://api.github.com/users';
    }
    render() {
        return (
            <div>
                <EnhancedTable />
            </div>
        )
    }
}

export default TableData;
